//import logo from './logo.svg';
import './App.css';
import UserComponent from "./components/user.component";
import {useState} from "react";

function App() {

    const usersArray = [
        {
            name: 'Iron Man',
            age: 40,
            style: {background: 'red'},
            link: 'data:image/jpeg;base64,'
        },
        {
            name: 'Deadpool',
            age: 35,
            style: {background: 'blue'},
            link: 'data:image/jpeg;base64,'
        },
        {
            name: 'Doctor Strange',
            age: 39,
            style: {background: 'yellow'},
            link: 'data:image/jpeg;base64,'
        }
    ];

    let [users, setUsers] = useState(usersArray);
    let deleteUsers = () => {
        users.pop();
        setUsers([...users]);
    }


    let [counter, setCounter] = useState(0);

    let increment = () => {
        counter += 100;
        setCounter(counter);
    }
    let decrement = () => {
        if (!counter) return;
        counter -= 100;
        setCounter(counter);
    }
    let reset = () => {
        setCounter(0);
    }
    return (
        <div id="app">
            <button onClick={increment}>Increment</button>
            <button onClick={decrement}>Decrement</button>
            <button onClick={reset}>Reset</button>
            <h1>{counter}</h1>
            {users.map((value, index) => {
                return <UserComponent key = {index} name={value.name} age={value.age} style={value.style} img={value.link}/>
            })}
            <button onClick={deleteUsers}>Delete one user</button>
        </div>
    );
}

export default App;
